import React, { Component } from 'react'
import { Navbar } from 'react-bootstrap';
import { Nav } from 'react-bootstrap';
import { NavDropdown } from 'react-bootstrap';

export class OurNavBar extends Component {
    constructor(){
      super();
    }

    handleClickNav(event){
      //this.props.changeComponent(active, noactive);
      event.preventDefault();
      console.log(event.target.name);
    }

    render() {
        const { changeComponent } = this.props;
        console.log(changeComponent);
        return (
            <div>
                <h1>Here goes the NavBar</h1>
                <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
                  <Navbar.Brand name="activeHome">React-Bootstrap</Navbar.Brand>
                  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                  <Navbar.Collapse id="responsive-navbar-nav">
                  <Nav className="mr-auto">
                    <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
                      <NavDropdown.Item name="activeForm" onClick={this.handleClickNav}>Form</NavDropdown.Item>
                      <NavDropdown.Item name="activeGraphics" onClick={this.handleClickNav}>Graphics</NavDropdown.Item>
                      <NavDropdown.Item name="activeAdvice" onClick={this.handleClickNav}>Advice</NavDropdown.Item>
                    </NavDropdown>
                  </Nav>
                </Navbar.Collapse>
              </Navbar>
            </div>
        )
    }
}

export default OurNavBar;
